import React from 'react';
import './Projects.css';

function Projects() {
    return (
        <div className="projects">
            <p>
                Projects will be listed here soon.
                <br></br>
                In the meantime, please check out the links below!
            </p>

            <div className="card">
                <img src="https://alns.co.uk/wp-content/uploads/2020/06/Playstore-logo.jpg" alt="logo"/>
                <h4>Project Name</h4>
                <p>Description</p>
            </div>

        </div>
    );
}

export default Projects;
